import Navbar from "./components/Navbar"
import { Routes, Route } from "react-router-dom";
import Home from "./components/"

function App(){
  return(
    <div>
      <div>
        <Navbar/>
      </div>
      <Routes>
        <Route path="\" element={<Home/>}></Route>
      </Routes>
    </div>
  )
}
export default App;
